import React, { useEffect, useState } from "react";
import {apiRequest} from ''

const CountryCodesPage = () => {
    const [countryCodes, setCountryCodes] = useState([]);

    useEffect(() => {
        fetchCountryCodes();
    }, []);

    const fetchCountryCodes = async () => {
        const response = await apiRequest("CountryCodes_API", "get");
        if (response) {
            setCountryCodes(response);
        }
    };

    return (
        <div className="p-4">
            <h1 className="text-2xl font-bold mb-4">Country Codes</h1>
            <ul className="list-disc pl-5">
                {countryCodes.length > 0 ? (
                    countryCodes.map((code, index) => (
                        <li key={index} className="text-lg">{code.name} ({code.code})</li>
                    ))
                ) : (
                    <p>Loading...</p>
                )}
            </ul>
        </div>
    );
};

export default CountryCodesPage;
